import './App.css'

//JS object 
interface Car {
  brand: string;
  model: string;
  year: number;
  image: string;
}


// Card component using props.children
interface CardProps {
  title: string;
  children: React.ReactNode; // Type for children prop
}

const car: Car = {
  brand: "BMW",
  model: "M5",
  year: 2021,
  image: "data:image/jpeg;base64,"
}

const cars: Car[] = [
  {
    brand: "Toyota",
    model: "Corolla",
    year: 2023,
    image: "data:image/jpeg;base64,", // example image from Pixabay :contentReference[oaicite:1]{index=1}
  },
  {
    brand: "Honda",
    model: "Civic",
    year: 2022,
    image: "data:image/jpeg;base64,", // example free stock image from Pixabay :contentReference[oaicite:2]{index=2}
  },
  {
    brand: "Ford",
    model: "Mustang",
    year: 2021,
    image: "data:image/jpeg;base64,", // example Mustang free image from Pixabay :contentReference[oaicite:3]{index=3}
  },
  {
    brand: "Tesla",
    model: "Model 3",
    year: 2024,
    image: "data:image/jpeg;base64,", // example Tesla Model 3 from Pixabay :contentReference[oaicite:4]{index=4}
  },
];

// Props destructuring in Avatar component
// Default value of size
function Avatar({ car , size = 0 }: { car: Car; size: number }) {
  return (
    <img
      className="rounded-lg shadow-md object-cover hover:scale-110 hover:shadow-2xl transition-all duration-300 ease-in-out cursor-pointer"
      src={car.image}
      alt={car.model}
      width={size}
      height={size}
    />
  );
}
// Without destructuring
function AvatarWithoutDestructing(props: { car:   Car; size: number }) {
    return (
    <img
      className="rounded-lg shadow-md object-cover hover:scale-110 hover:shadow-2xl transition-all duration-300 ease-in-out cursor-pointer"
      src={props.car.image}
      alt={props.car.model}
      width={props.size}
      height={props.size}
    />
  );
}

// Profile component
function Profile() {
  return (
    // Passing props to Avatar component
    <div className="flex items-center justify-center p-8 bg-gradient-to-r from-blue-50 to-indigo-50 rounded-lg">
      <div className="text-center rounded-lg p-4 transition-all duration-500 transform hover:-translate-y-2 hover:shadow-2xl">
        <Avatar car={car} size={100} />
        <h2 className="mt-4 text-2xl font-bold text-gray-800">{car.brand}</h2>
        <p className="text-indigo-600 font-semibold">{car.model}</p>
      </div>
    </div>
  );
}

function App() {
  // Mapping through the cars array to create a list of car details
  const carList = cars.map((carItem, index) => (
    <div
      key={index}
      className="bg-white rounded-lg shadow-lg p-6 hover:shadow-2xl hover:bg-indigo-50 transition-all duration-300 transform hover:scale-105 hover:-translate-y-2 cursor-pointer group"
    >
      <h3 className="text-xl font-bold text-gray-800 mb-4">
        {carItem.brand} {carItem.model}
      </h3>
      {/* Passing props */}
      <Avatar car={carItem} size={80} />
      <p className="mt-4 text-lg text-gray-600">
        <span className="font-semibold text-indigo-600">Year:</span> {carItem.year}
      </p>
    </div>
  ));

  return (
    <>
    // Jsx syntax
    <div className="min-h-screen bg-gradient-to-br from-gray-900 via-indigo-900 to-black p-8 transition-all duration-1000 hover:from-gray-800 hover:via-purple-900">
      <div className="max-w-7xl mx-auto">
        {/* Main Profile Section */}
        <div className="mb-12">
          <Profile />
        </div>

        {/* Car List Section */}
        <div className="mt-12">
          <h2 className="text-4xl font-bold text-white mb-8 hover:text-indigo-300 transition-colors duration-300">
            Our Car Collection
          </h2>
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
            {/* Car list */}
            {carList}
          </div>
        </div>
        {/* Props without destructrinng */}
        <AvatarWithoutDestructing car={car} size={100} />

        {/* Card component example */}
        <div className="mt-12">
          <CardExample />
          </div>
      </div>
    </div>
    </>
  );
}

// Props children example
function Card({ title, children }: CardProps) {
  return (
    <div className="bg-white rounded-lg shadow-lg p-6">
      <h3 className="text-xl font-bold text-gray-800 mb-4">{title}</h3>
      <div className="text-gray-600">
        {children}
      </div>
    </div>
  );
}

// Example usage of Card component with children
function CardExample() {
  return (
    <div className="space-y-4">
      <Card title="About BMW">
        <p>BMW M5 is a high-performance luxury sedan known for its power and precision.</p>
      </Card>
      
      <Card title="Features">
        <ul className="list-disc ml-5">
          <li>Twin-turbo engine</li>
          <li>Advanced suspension</li>
          <li>Luxury interior</li>
        </ul>
      </Card>
    </div>
  );
}

export default App